import React from 'react';

import { Navbar } from './components/Navbar/Navbar';
import { Home } from './components/Navbar/Navbar';

function App() {
  return (
    <React.Fragment>
      <Navbar />
      <div className="container pt-4">
        <Home />
      </div>
    </React.Fragment>
  );
}

export default App;
